"""
实现strStr()函数。
给定一个haystack 字符串和一个 needle 字符串，在 haystack 字符串中找出 needle 字符串出现的第一个位置 (从0开始)。如果不存在，则返回 -1。

示例 1:
输入: haystack = "hello", needle = "ll"
输出: 2
示例 2:
输入: haystack = "aaaaa", needle = "bba"
输出: -1
说明:

当needle是空字符串时，我们应当返回什么值呢？这是一个在面试中很好的问题。
对于本题而言，当needle是空字符串时我们应当返回 0 。这与C语言的strstr()以及 Java的indexOf()定义相符。

来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/implement-strstr
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
"""


class Solution:
    # 超时
    def strStr(self, haystack: str, needle: str) -> int:
        def part_table(pattern):
            pre_fix = set()
            table = [0]
            for i in range(1, len(pattern)):
                pre_fix.add(pattern[:i])
                post_fix = {pattern[j:i + 1] for j in range(1, i + 1)}
                # print(pre_fix,post_fix)
                # table.append(len(pre_fix & post_fix))
                ls = list(pre_fix & post_fix)
                if ls:
                    ls.sort(key=lambda x: len(x), reverse=True)
                    table.append(len(ls[0]))
                else:
                    table.append(0)

            return table

        partial_table = part_table(needle)
        print(partial_table)
        m, n = len(haystack), len(needle)
        curr = 0
        while curr <= m - n:
            for i in range(n):
                if haystack[i + curr] != needle[i]:
                    curr += max(i - partial_table[i - 1], 1)
                    break
            else:
                return curr
        return -1

    def strStr(self, haystack: str, needle: str) -> int:
        def same_start_end(s):
            """最长前后缀相同的字符位数"""
            n = len(s)  # 整个字符串长度
            j = 0  # 前缀匹配指向
            i = 1  # 后缀匹配指向
            result_list = [0] * n
            while i < n:
                if j == 0 and s[j] != s[i]:  # 比较不相等并且此时比较的已经是第一个字符了
                    result_list[i] = 0  # 值为０
                    i += 1  # 向后移动
                elif s[j] != s[
                    i] and j != 0:  # 比较不相等,将j值设置为ｊ前一位的result_list中的值，为了在之前匹配到的子串中找到最长相同前后缀
                    j = result_list[j - 1]
                elif s[j] == s[i]:  # 相等则继续比较
                    result_list[i] = j + 1
                    j = j + 1
                    i = i + 1
            return result_list

        def kmp(s, p):
            """kmp算法,s是字符串，p是模式字符串，返回值为匹配到的第一个字符串的第一个字符的索引，没匹配到返回-1"""
            s_length = len(s)
            p_length = len(p)
            i = 0  # 指向s
            j = 0  # 指向p
            next = same_start_end(p)
            while i < s_length:
                if s[i] == p[j]:  # 对应字符相同
                    i += 1
                    j += 1
                    if j >= p_length:  # 完全匹配
                        return i - p_length
                elif s[i] != p[j]:  # 不相同
                    if j == 0:  # 与模式比较的是模式的第一个字符
                        i += 1
                    else:  # 取模式当前字符之前最长相同前后缀的前缀的后一个字符继续比较
                        j = next[j]
            if i == s_length:  # 没有找到完全匹配的子串
                return -1

        if not needle:
            return 0
        return kmp(haystack, needle)


